import React, { Component } from 'react';
import { Navbar, Container, NavbarBrand } from 'reactstrap';
import styles from './Header.module.scss';

export default class Header extends Component {
    constructor(props){
        super(props);
    }


    render() {

        return (
            <Navbar className={styles.navbar} color='dark' expand='lg'>
                <Container>
                    <NavbarBrand href='/'>
                        <span className='navbar__logo'>labirinthia.ru</span>
                    </NavbarBrand>
                </Container>
            </Navbar>
        );
    }
}
